import React from 'react'
import Layout from './../components/Layout';

export default class About extends React.Component {
    
    render() {
        return (
            <Layout>
                <div className="row">
                    <div className="col-md-6">
                        <img className="img-fluid pic" src="/images/demo.jpg" />
                    </div>
                    <div className="col-md-6">

                    </div>
                </div>
                <style jsx>{`
                    .row{
                        padding: 2em;
                    }
                    .pic{
                        width: 100%;
                    }
                `}</style>
            </Layout>
        )
    }
}
